import {useState} from 'react';


function Profile(props: any){
    console.table(props.items)

    return(
        <div>
            <h1>{props?.items[0].account_id}</h1>
            <img src={props?.items[0].profile_image}></img>
            <h1>1</h1>
        </div>
    )
}

export default Profile;
